Thanks for upstreaming the change into eigen.
I learned that our upgrade of eigen is blocked right now due to internally and externally a few eigen pieces being out of sync.
@rmlarsen is right now working to get this resolved. We will then upgrade our eigen dependency once all issues are resolved. However, the current issue is a rarther involved one and it may take up to a couple of weeks.

